import HorizontalNavsCustom1 from '../components-custom/HorizontalNavsCustom1';
import ElementsCustom2 from '../components-custom/ElementsCustom2';
import HeadersCustom3 from '../components-custom/HeadersCustom3';
import HeadersCustom4 from '../components-custom/HeadersCustom4';
import StructureContainer from '../components/__structures/StructureContainer';
import FootersCustom5 from '../components-custom/FootersCustom5';

export default function Index() {
  return (
    <React.Fragment>
      <HorizontalNavsCustom1 />

      <ElementsCustom2 />

      <HeadersCustom3 />

      <HeadersCustom4 />

      <StructureContainer bucket1={[<FootersCustom5 />]} />
    </React.Fragment>
  );
}
